import React from 'react';

const User = ({children}) =>  {
	return (
	  <div>
        <header>
        <ul>
            <li><a class="active" href="#">Home</a></li>
            <li><a href="#">News</a></li>
            <li><a href="#">Contact</a></li>
            <li><a href="#">About</a></li>
        </ul>
        </header>
        <main>
            {children}
        </main>
        <footer>
            <p>Author: Hege Refsnes
                <br />
            <a href="mailto:hege@example.com">hege@example.com</a></p>
        </footer>
	  </div>
	);
}

export default User;
